contracts/Halal.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract Halal{
    struct account_data{
        string account_id;
        string name;
        string role;
        uint created_at;
    }
    mapping( bytes32 => account_data ) public mappingAccount; 

    struct transaction{
        string umkm_id;
        bool reg_status;
        uint reg_date;
        string bpjph_desc;
        string bpjph_result;
        string lph_appintment;
        string bpjph_id;
        string lph_desc;
        string review_status;
        string desicion_mui;
        bool mui_approved;
        string cert_data;
    }

    mapping (bytes32 => transaction) public mappingTransaction;

    function add_account(
        string memory account_id,
        string memory name,
        string memory role
    ) public {
        bytes32 id = keccak256(abi.encodePacked(account_id));
        account_data storage acc = mappingAccount[id];
        acc.account_id = account_id;
        acc.name = name;
        acc.role = role;
        acc.created_at = block.timestamp;
    }

}

